import React from 'react';
import './Keramikos.scss';

const Keramikos : React.FC = props => {
    return (
        <div className={`keramikos`} id={`keramikos`}>
            <h2>Keramikos (or Kerameikos) and Keramikos museum</h2>
            <div className={`practical-info`}>
                <b>Time spent there:</b> 45 min<br></br>
                <b>Entrance:</b> <a href='https://goo.gl/maps/yu2SKtVtDPwzSo3w8' target='_blank'>here</a>
            </div>
            <div>
                <p>
                    It was a cemetery where important Athenians fallen during wars were burried (500 - 300 BC) and fortification walls.
                    The small museum displays grave decorations and pottery.
                </p>
                <p>
                    The ruins are partly visible from outside.
                </p>
            </div>
        </div>
    );
}

export default Keramikos;
